// src/FluentEmoji/utils.js
var { Patcher, ReactUtils } = BdApi;
var log = (message) => {
  console.log(`%c[${PLUGIN_NAME}]%c ${message}`, "color: #3a71c1; font-weight: 700;", "");
};
var err = (message, error) => {
  console.log(`%c[${PLUGIN_NAME}]%c ${message}`, "color: red; font-weight: 700;", "");
  if (error) {
    console.groupCollapsed("%cError: " + error.message, "color: red;");
    console.error(error.stack);
    console.groupEnd();
  }
};
var toSelector = (className) => {
  return Array.isArray(className) ? `.${className.join(".")}` : `.${className}`;
};
var waitForSelector = async (selector) => {
  return new Promise((resolve, reject) => {
    const observer = new MutationObserver((mutationsList) => {
      for (const mutation of mutationsList) {
        if (mutation.type === "childList" && document.querySelector(selector)) {
          observer.disconnect();
          resolve();
          return;
        }
      }
    });
    observer.observe(document.documentElement, {
      childList: true,
      subtree: true
    });
  });
};
var reRender = (moduleName, selector) => {
  const target = document.querySelector(selector);
  if (!target)
    return;
  const instance = ReactUtils.getOwnerInstance(target);
  const unpatch = Patcher.instead(moduleName, instance, "render", () => unpatch());
  instance.forceUpdate(() => instance.forceUpdate());
};
var emojiSrcFromGlyph = (glyph) => {
  const unicode = [...glyph].map((cp) => cp.codePointAt(0).toString(16).padStart(4, "0")).join(" ");
  if (!unicode.length)
    return;
  return emojis_default[unicode]?.src;
};

// src/FluentEmoji/discordModules/index.js
var {
  Webpack: { getByKeys }
} = BdApi;
var EmojiUtils = BdApi.Webpack.getByKeys(
  "isEmojiFilteredOrLocked",
  "filterUnsupportedEmojis"
);

// src/FluentEmoji/patches/Emoji.js
var { Patcher: Patcher2 } = BdApi;
var patch = async () => {
  Patcher2.after(PLUGIN_NAME, EmojiUtils, "getURL", (_, args, ret) => {
    if (!args || !args.length)
      return;
    const newSrc = emojiSrcFromGlyph(args[0]);
    if (!newSrc) {
      return;
    }
    return `${EMOJI_SRC_BASE}/${newSrc}`;
  });
};
var Emoji_default = {
  name: "Emoji",
  patch
};

// src/FluentEmoji/classes.js
var {
  Webpack: { getByKeys: getByKeys2 }
} = BdApi;
var classes_default = {
  emojiSpriteImage: getByKeys2("emojiSpriteImage")
};

// src/FluentEmoji/patches/ExpressionPickerEmoji.js
var { Patcher: Patcher3, ReactUtils: ReactUtils2 } = BdApi;
var patch2 = async () => {
  const ExpressionPickerEmojiSelector = toSelector(classes_default.emojiSpriteImage.emojiSpriteImage);
  await waitForSelector(ExpressionPickerEmojiSelector);
  const ExpressionPickerEmoji = ReactUtils2.getInternalInstance(
    document.querySelector(ExpressionPickerEmojiSelector)
  )?.return?.elementType;
  Patcher3.after(PLUGIN_NAME, ExpressionPickerEmoji, "type", (_, args, ret) => {
    if (!args || !args[0])
      return;
    const glyph = args[0]?.emoji?.surrogates;
    if (!glyph)
      return;
    const newSrc = emojiSrcFromGlyph(glyph);
    if (!newSrc) {
      return;
    }
    if (!ret?.props?.style)
      return;
    ret.props.style = {
      backgroundImage: `url("${EMOJI_SRC_BASE}/${newSrc}")`,
      backgroundSize: "contain",
      height: "40px",
      width: "40px"
    };
  });
  reRender(PLUGIN_NAME, ExpressionPickerEmojiSelector);
};
var ExpressionPickerEmoji_default = {
  name: "ExpressionPickerEmoji",
  patch: patch2
};

// src/FluentEmoji/patches/index.js
var patches_default = [Emoji_default, ExpressionPickerEmoji_default];

// src/FluentEmoji/index.js
var { Patcher: Patcher4, UI } = BdApi;
var FluentEmoji = class {
  /**
   * Constructs a new instance of the FluentEmoji plugin class.
   * @param {object} meta - The meta information to initialize the instance.
   * @constructor
   */
  constructor(meta) {
    this.meta = meta;
  }
  /**
   * Initializes the plugin.
   * @async
   * @returns {Promise<void>}
   */
  async init() {
    patches_default.forEach((patchModule) => {
      try {
        patchModule.patch();
      } catch (e) {
        err(`Failed to run patch ${patchModule.name}!`, e);
      }
    });
  }
  /**
   * Starts the plugin.
   * @returns {void}
   */
  start() {
    log(`version ${this.meta.version} has started.`);
    try {
      this.init();
    } catch (e) {
      err("Failed to initialize!", e);
      UI.showToast(`Failed to initialize ${this.meta.name}!`, {
        type: "error"
      });
    }
  }
  /**
   * Stops the plugin by undoing any changes made during initialization.
   * @returns {void}
   */
  stop() {
    Patcher4.unpatchAll(this.meta.name);
    log(`version ${this.meta.version} has stopped.`);
  }
};
